{"translationLines":[{"lineNumber":82591,"originalJapaneseLine":"「んぐっ、んぐっ、","translatedEnglishLine":"\"Gulp, gulp,"},{"lineNumber":82592,"originalJapaneseLine":"　ぷっはあああ……」","translatedEnglishLine":"　Puhhaaah...\""},{"lineNumber":82593,"originalJapaneseLine":"ランスはおとそを一口飲むと、","translatedEnglishLine":"Lance took a sip of otoso,"},{"lineNumber":82594,"originalJapaneseLine":"長い溜め息を吐き出した。","translatedEnglishLine":"and let out a long sigh."},{"lineNumber":82595,"originalJapaneseLine":"周りにいる大量の兵達もお酒を飲み、お餅を食べ、","translatedEnglishLine":"The many soldiers around him were also drinking sake and eating mochi,"},{"lineNumber":82596,"originalJapaneseLine":"思い思いの方法で正月を楽しんでいる。","translatedEnglishLine":"enjoying New Year's in their own ways."},{"lineNumber":82597,"originalJapaneseLine":"「シィル、正月らしいことは","translatedEnglishLine":"\"Seal, have we done"},{"lineNumber":82598,"originalJapaneseLine":"　もう大概やったか？」","translatedEnglishLine":"pretty much everything typical for New Year's?\""},{"lineNumber":82599,"originalJapaneseLine":"「はい、福笑いもコマ回しもたこ揚げも、","translatedEnglishLine":"\"Yes, we've done fukuwarai, spinning tops, and kite flying,"},{"lineNumber":82600,"originalJapaneseLine":"　全部やりました」","translatedEnglishLine":"we tried them all.\""},{"lineNumber":82601,"originalJapaneseLine":"「そーかそーか、やはりお正月とは","translatedEnglishLine":"\"I see, I see. After all, New Year's has to be like this!\""},{"lineNumber":82602,"originalJapaneseLine":"　こうでなければいかんな！」","translatedEnglishLine":"It simply must be this way!\""},{"lineNumber":82603,"originalJapaneseLine":"「よーし、あとはおせちを食べながら","translatedEnglishLine":"\"Alright, next we'll eat osechi"},{"lineNumber":82604,"originalJapaneseLine":"　のんびり魔法ビジョンで駅伝見るぞー」","translatedEnglishLine":"and relaxedly watch the ekiden on Magic Vision.\""},{"lineNumber":82605,"originalJapaneseLine":"「はーい」","translatedEnglishLine":"\"Okay!\""},{"lineNumber":82606,"originalJapaneseLine":"「おせちに海老と伊達巻きと","translatedEnglishLine":"\"Did you include shrimp, datemaki,"},{"lineNumber":82607,"originalJapaneseLine":"　栗きんとんと黒豆は入れたな？」","translatedEnglishLine":"kuri kinton, and kuromame in the osechi?\""},{"lineNumber":82608,"originalJapaneseLine":"「はい、ばっちりです」","translatedEnglishLine":"\"Yes, all perfectly prepared.\""},{"lineNumber":82609,"originalJapaneseLine":"「あのぉ、ランス様……","translatedEnglishLine":"\"Um, Lance-sama... May I also eat some osechi?\""},

{"lineNumber":82610,"originalJapaneseLine":"　私もおせち、食べていいですか？","translatedEnglishLine":"May I have some osechi too?\""},{"lineNumber":82611,"originalJapaneseLine":"「うーん……","translatedEnglishLine":"\"Hmm...\""},{"lineNumber":82612,"originalJapaneseLine":"「数の子と昆布巻きは全部やる。","translatedEnglishLine":"\"I want all the kazunoko and kobumaki."},

{"lineNumber":82613,"originalJapaneseLine":"　俺はあれいらん」","translatedEnglishLine":"I don't need those.\""},{"lineNumber":82614,"originalJapaneseLine":"「うう、せっかく作ったのに……","translatedEnglishLine":"\"Ugh, even though I went to the trouble of making them...\""},{"lineNumber":82615,"originalJapaneseLine":"　数の子も昆布巻きも美味しいですよ？」","translatedEnglishLine":"The kazunoko and kobumaki are delicious, you know?\""},{"lineNumber":82616,"originalJapaneseLine":"「肉や甘いもんの方が美味い。","translatedEnglishLine":"\"Meat and sweets taste better to me."},{"lineNumber":82617,"originalJapaneseLine":"　大体おせちは正月だから食うだけで","translatedEnglishLine":"Besides, osechi is mostly eaten just because it's New Year's,"},{"lineNumber":82618,"originalJapaneseLine":"　別に美味いとも思っとらん」","translatedEnglishLine":"I don't really think it's especially tasty.\""},{"lineNumber":82619,"originalJapaneseLine":"「しくしく……","translatedEnglishLine":"\"Sob, sob...\""},{"lineNumber":82620,"originalJapaneseLine":"　やっぱり、そうだったんですね……」","translatedEnglishLine":"So that's how it was after all...\""},{"lineNumber":82621,"originalJapaneseLine":"穏やかな喧噪――","translatedEnglishLine":"The calm bustle—"},{"lineNumber":82622,"originalJapaneseLine":"ガヤガヤと賑やかに、","translatedEnglishLine":"buzzing noisily,"},{"lineNumber":82623,"originalJapaneseLine":"誰も彼もが笑顔で正月を楽しんでいた。","translatedEnglishLine":"everyone was enjoying New Year's with smiles on their faces."},{"lineNumber":82624,"originalJapaneseLine":"「…………」","translatedEnglishLine":"\"............\""},{"lineNumber":82625,"originalJapaneseLine":"ただ一人、ビスケッタだけは","translatedEnglishLine":"Only Biscetta,"},{"lineNumber":82626,"originalJapaneseLine":"手持ちの懐中時計を睨んでいた。","translatedEnglishLine":"was staring at the pocket watch in her hand."},{"lineNumber":82627,"originalJapaneseLine":"「5、4、3、2、1……――」","translatedEnglishLine":"\"5, 4, 3, 2, 1...—\""},{"lineNumber":82628,"originalJapaneseLine":"「皆様、10時になりました」","translatedEnglishLine":"\"Everyone, it is now 10 o'clock.\""},{"lineNumber":82629,"originalJapaneseLine":"水を打ったように辺りが静まり、","translatedEnglishLine":"The area fell silent as if water had been struck,"},{"lineNumber":82630,"originalJapaneseLine":"ビスケッタの声だけが響いた。","translatedEnglishLine":"only Biscetta's voice echoed."},{"lineNumber":82631,"originalJapaneseLine":"「はい、ではお仕事に戻って下さい」","translatedEnglishLine":"\"Now, please return to your work.\""},{"lineNumber":82632,"originalJapaneseLine":"ビスケッタの時報、そしてウルザの一声で","translatedEnglishLine":"At Biscetta's time call and Ulzza's single shout,"},{"lineNumber":82633,"originalJapaneseLine":"皆が一斉に立ち上がる。","translatedEnglishLine":"everyone stood up simultaneously."},{"lineNumber":82634,"originalJapaneseLine":"「撤収するぞー！","translatedEnglishLine":"\"Let's pack up!\""},{"lineNumber":82635,"originalJapaneseLine":"　おい、誰かテーブル運ぶの手伝ってくれー！」","translatedEnglishLine":"Hey, someone help carry the tables!\""},{"lineNumber":82636,"originalJapaneseLine":"「お料理片しまーす」","translatedEnglishLine":"\"I'm putting the food away!\""},{"lineNumber":82637,"originalJapaneseLine":"「ゴミがある人はこちらの袋にどうぞー」","translatedEnglishLine":"\"If you have trash, please put it in this bag!\""},{"lineNumber":82638,"originalJapaneseLine":"「夜間の電話番、本当にお疲れ様でした」","translatedEnglishLine":"\"Thank you very much for your hard work on night duty phone watch.\""},{"lineNumber":82639,"originalJapaneseLine":"「いえ、誰かがやらねばいけないことですから。","translatedEnglishLine":"\"No, it's something someone has to do."},{"lineNumber":82640,"originalJapaneseLine":"　少しですが正月気分が味わえて嬉しかったです」","translatedEnglishLine":"I was happy to enjoy a little bit of New Year's feeling.\""}]}

